import React from "react";
import Member from "./member/member"

// member = [{src:"null",name:"Jone Dow"},{src:"null",name:"anonymous"}];
const Team = props =>{
    var member = [{src:"null",name:"Jone Dow"},{src:"null",name:"anonymous"}];

    return (
        member.forEach(element => <Member src = {element.src} name = {element.name}/>)
    )
}

export default Team;
